import UserMenu from "./UserMenu";
import logoImg from "../assets/logo.png";
import styles from "./Nav.module.css";

function Nav() {
  return (
    <div className={styles.nav}>
      <ul className={styles.menu}>
        <li>
          <img src={logoImg} alt="Fanda-market Logo" />
        </li>
        <li>자유게시판</li>
        <li>중고마켓</li>
      </ul>
      <UserMenu />
    </div>
  );
}

export default Nav;
